import{_ as e}from"./BreadCrumbs.058581cb.js";import{a as p,c as i}from"./entry.92e2d9ec.js";import{F as b,H as d,y as v,G as l,m as s,U as o,V as c}from"./swiper-vue.27e78005.js";import"./nuxt-link.11b8d193.js";import"./index.e8ce400e.js";const h=a=>(o("data-v-a512bd9e"),a=a(),c(),a),r=h(()=>d("div",{class:"bg white-theme-only gradient-bg"},null,-1)),n=l('<h1 data-v-a512bd9e>Политика обработки персональных данных</h1><h2 data-v-a512bd9e>1. Общие положения</h2><p data-v-a512bd9e> 1.1. Настоящий документ определяет политику Общества с ограниченной ответственностью «Тис Лоджистик» (далее ООО «Тис Лоджистик», Оператор) в отношении обработки персональных данных (далее Политика), составлен в соответствии с требованиями Федерального закона от 27.07.2006. №152-ФЗ «О персональных данных» (далее - Закон о персональных данных) и определяет порядок обработки персональных данных и меры по обеспечению безопасности персональных данных, предпринимаемые ООО «Тис Лоджистик». </p><p data-v-a512bd9e> 1.2. Оператор ставит своей важнейшей целью и условием осуществления своей деятельности соблюдение прав и свобод человека и гражданина при обработке его персональных данных, в том числе защиты прав на неприкосновенность частной жизни, личную и семейную тайну. </p><p data-v-a512bd9e> 1.3. Политика применяется ко всей информации, которую Оператор может получить о посетителях веб-сайта, а также является общедоступной и подлежит размещению на официальном сайте <a href="https://tislogistic.ru/" data-v-a512bd9e>https://tislogistic.ru/</a>. </p><h2 data-v-a512bd9e>2. Основные понятия, используемые в Политике</h2><p data-v-a512bd9e> 2.1. Автоматизированная обработка персональных данных – обработка персональных данных с помощью средств вычислительной техники. </p><p data-v-a512bd9e> 2.2. Блокирование персональных данных – временное прекращение обработки персональных данных (за исключением случаев, если обработка необходима для уточнения персональных данных). </p><p data-v-a512bd9e> 2.3. Веб-сайт – совокупность графических и информационных материалов, а также программ для ЭВМ и баз данных, обеспечивающих их доступность в сети интернет по сетевому адресу <a href="https://tislogistic.ru" data-v-a512bd9e>https://tislogistic.ru</a>. </p><p data-v-a512bd9e> 2.4. Информационная система персональных данных — совокупность содержащихся в базах данных персональных данных, и обеспечивающих их обработку информационных технологий и технических средств. </p><p data-v-a512bd9e> 2.5. Обезличивание персональных данных — действия, в результате которых невозможно определить без использования дополнительной информации принадлежность персональных данных конкретному Пользователю или иному субъекту персональных данных. </p><p data-v-a512bd9e> 2.6. Обработка персональных данных – любое действие (операция) или совокупность действий (операций), совершаемых с использованием средств автоматизации или без использования таких средств с персональными данными, включая сбор, запись, систематизацию, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ), обезличивание, блокирование, удаление, уничтожение персональных данных. </p><p data-v-a512bd9e> 2.7. Оператор – государственный орган, муниципальный орган, юридическое или физическое лицо, самостоятельно или совместно с другими лицами организующие и (или) осуществляющие обработку персональных данных, а также определяющие цели обработки персональных данных, состав персональных данных, подлежащих обработке, действия (операции), совершаемые с персональными данными. </p><p data-v-a512bd9e> 2.8. Персональные данные – любая информация, относящаяся прямо или косвенно к определенному или определяемому Пользователю веб-сайта <a href="https://tislogistic.ru" data-v-a512bd9e>https://tislogistic.ru</a>. </p><p data-v-a512bd9e> 2.9. Персональные данные, разрешенные субъектом персональных данных для распространения, - персональные данные, доступ неограниченного круга лиц к которым предоставлен субъектом персональных данных путем дачи согласия на обработку персональных данных, разрешенных субъектом персональных данных для распространения в порядке, предусмотренном Законом о персональных данных (далее - персональные данные, разрешенные для распространения). </p><p data-v-a512bd9e> 2.10. Пользователь – любой посетитель веб-сайта <a href="https://tislogistic.ru" data-v-a512bd9e>https://tislogistic.ru</a>. </p><p data-v-a512bd9e> 2.11. Предоставление персональных данных – действия, направленные на раскрытие персональных данных определенному лицу или определенному кругу лиц. </p><p data-v-a512bd9e> 2.12. Распространение персональных данных – любые действия, направленные на раскрытие персональных данных неопределенному кругу лиц (передача персональных данных) или на ознакомление с персональными данными неограниченного круга лиц, в том числе обнародование персональных данных в средствах массовой информации, размещение в информационно-телекоммуникационных сетях или предоставление доступа к персональным данным каким-либо иным способом. </p><p data-v-a512bd9e> 2.13. Трансграничная передача персональных данных – передача персональных данных на территорию иностранного государства органу власти иностранного государства, иностранному физическому или иностранному юридическому лицу. </p><p data-v-a512bd9e> 2.14. Уничтожение персональных данных – любые действия, в результате которых персональные данные уничтожаются безвозвратно с невозможностью дальнейшего восстановления содержания персональных данных в информационной системе персональных данных и (или) уничтожаются материальные носители персональных данных. </p><h2 data-v-a512bd9e>3. Основные права и обязанности Оператора</h2><p data-v-a512bd9e>3.1. Оператор имеет право:</p><ul data-v-a512bd9e><li data-v-a512bd9e> получать от субъекта персональных данных достоверную информацию и/или документы, содержащие персональные данные </li><li data-v-a512bd9e> в случае отзыва субъекта персональных данных согласия на обработку персональных данных Оператор вправе продолжить обработку персональных данных без согласия субъекта персональных данных при наличии оснований, указанных в Законе о персональных данных </li><li data-v-a512bd9e> самостоятельно определять состав и перечень мер, необходимых и достаточных для обеспечения выполнения обязанностей, предусмотренных Законом о персональных данных и принятыми в соответствии с ним нормативными правовыми актами, если иное не предусмотрено Законом о персональных данных или другими федеральными законами. </li></ul><p data-v-a512bd9e>3.2. Оператор обязан:</p><ul data-v-a512bd9e><li data-v-a512bd9e> предоставлять субъекту персональных данных по его просьбе информацию, касающуюся обработки его персональных данных </li><li data-v-a512bd9e> организовывать обработку персональных данных в порядке, установленном действующим законодательством РФ </li><li data-v-a512bd9e> отвечать на обращения и запросы субъектов персональных данных и их законных представителей в соответствии с требованиями Закона о персональных данных </li><li data-v-a512bd9e> сообщать в уполномоченный орган по защите прав субъектов персональных данных по запросу этого органа необходимую информацию в течение 30 дней с даты получения такого запроса </li><li data-v-a512bd9e> публиковать или иным образом обеспечивать неограниченный доступ к настоящей Политике в отношении обработки персональных данных </li><li data-v-a512bd9e> принимать правовые, организационные и технические меры для защиты персональных данных от неправомерного или случайного доступа к ним, уничтожения, изменения, блокирования, копирования, предоставления, распространения персональных данных, а также от иных неправомерных действий в отношении персональных данных </li><li data-v-a512bd9e> прекратить передачу (распространение, предоставление, доступ) персональных данных, прекратить обработку и уничтожить персональные данные в порядке и случаях, предусмотренных Законом о персональных данных </li><li data-v-a512bd9e> исполнять иные обязанности, предусмотренные Законом о персональных данных. </li></ul><h2 data-v-a512bd9e>4. Цели сбора персональных данных</h2><ul data-v-a512bd9e><li data-v-a512bd9e> обеспечения соблюдения Конституции Российской Федерации, федеральных законов и иных нормативных правовых актов Российской Федерации </li><li data-v-a512bd9e> формирования справочных материалов для внутреннего информационного обеспечения деятельности ООО «Тис Лоджистик» </li><li data-v-a512bd9e>предоставления услуг по запросу Пользователей</li><li data-v-a512bd9e> информирования Пользователей о целевом маркетинге, обновлении услуг и рекламных предложениях на основании информационных предпочтений Пользователей </li><li data-v-a512bd9e> рассылки маркетинговых сообщений посредством электронной почты и SMS. </li></ul><h2 data-v-a512bd9e>5. Правовые основания обработки персональных данных</h2><p data-v-a512bd9e> 5.1. Правовыми основаниями обработки персональных данных Оператором являются: </p><ul data-v-a512bd9e><li data-v-a512bd9e>Конституция Российской Федерации</li><li data-v-a512bd9e>Гражданский кодекс Российской Федерации</li><li data-v-a512bd9e>Трудовой кодекс Российской Федерации</li><li data-v-a512bd9e>Налоговый кодекс Российской Федерации</li><li data-v-a512bd9e> федеральные законы, иные нормативно-правовые акты в сфере защиты персональных данных </li><li data-v-a512bd9e>уставные (учредительные) документы Оператора</li><li data-v-a512bd9e> договоры, заключаемые между оператором и субъектом персональных данных </li><li data-v-a512bd9e> согласия Пользователей на обработку их персональных данных, на обработку персональных данных, разрешенных для распространения. </li></ul><p data-v-a512bd9e> 5.2. Оператор обрабатывает персональные данные Пользователя только в случае их заполнения и/или отправки Пользователем самостоятельно через специальные формы, расположенные на сайте <a href="https://tislogistic.ru" data-v-a512bd9e>https://tislogistic.ru</a> или направленные Оператору посредством электронной почты. Заполняя соответствующие формы и/или отправляя свои персональные данные Оператору, Пользователь выражает свое согласие с данной Политикой. </p><p data-v-a512bd9e> 5.3. Оператор обрабатывает обезличенные данные о Пользователе в случае, если это разрешено в настройках браузера Пользователя (включено сохранение файлов «cookie» и использование технологии JavaScript). </p><p data-v-a512bd9e> 5.4. Субъект персональных данных самостоятельно принимает решение о предоставлении его персональных данных и дает согласие свободно, своей волей и в своем интересе. </p><h2 data-v-a512bd9e>6. Принципы обработки персональных данных</h2><p data-v-a512bd9e> 6.1. Обработка персональных данных осуществляется на законной и справедливой основе. </p><p data-v-a512bd9e> 6.2. Обработка персональных данных ограничивается достижением конкретных, заранее определенных и законных целей. Не допускается обработка персональных данных, несовместимая с целями сбора персональных данных. </p><p data-v-a512bd9e> 6.3. Не допускается объединение баз данных, содержащих персональные данные, обработка которых осуществляется в целях, несовместимых между собой. </p><p data-v-a512bd9e> 6.4. Обработке подлежат только персональные данные, которые отвечают целям их обработки. </p><p data-v-a512bd9e> 6.5. Содержание и объем обрабатываемых персональных данных соответствуют заявленным целям обработки. Не допускается избыточность обрабатываемых персональных данных по отношению к заявленным целям их обработки. </p><p data-v-a512bd9e> 6.6. При обработке персональных данных обеспечивается точность персональных данных, их достаточность, а в необходимых случаях и актуальность по отношению к целям обработки персональных данных. Оператор принимает необходимые меры и/или обеспечивает их принятие по удалению или уточнению неполных или неточных данных. </p><p data-v-a512bd9e> 6.7. Хранение персональных данных осуществляется в форме, позволяющей определить субъекта персональных данных, не дольше, чем этого требуют цели обработки персональных данных, если срок хранения персональных данных не установлен федеральным законом, договором, стороной которого, выгодоприобретателем или поручителем по которому является субъект персональных данных. Обрабатываемые персональные данные уничтожаются либо обезличиваются по достижении целей обработки или в случае утраты необходимости в достижении этих целей, если иное не предусмотрено федеральным законом. </p><h2 data-v-a512bd9e>7. Объем обрабатываемых персональных данных:</h2><p data-v-a512bd9e> 7.1. Оператор обрабатывает персональные данные клиентов с их согласия, предоставляемого на срок действия заключенных с ними договоров. В случаях, предусмотренных ФЗ «О персональных данных», согласие предоставляется в письменном виде. В иных случаях согласие считается полученным при заключении договора или при совершении конклюдентных действий. </p><p data-v-a512bd9e> 7.2. Оператор обрабатывает персональные данные клиентов в течение сроков действия заключенных с ними договоров. Оператор может обрабатывать персональные данные клиентов после окончания сроков действия заключенных с ними договоров в течение срока, установленного п. 5 ч. 3 ст. 24 части первой НК РФ, ч. 1 ст. 29 ФЗ «О бухгалтерском учёте» и иными нормативными правовыми актами. </p><p data-v-a512bd9e> 7.3. Оператор обрабатывает персональные данные потенциальных клиентов с их согласия, которое дается автоматически при заполнении потенциальным клиентом форм, размещенных на сайте ООО «Тис Лоджистик». </p><p data-v-a512bd9e> 7.4. Оператор обрабатывает персональные данные потенциальных клиентов в течение сроков рассмотрения их заявок на заключение договоров. </p><p data-v-a512bd9e> 7.5. Оператор обрабатывает следующие персональные данные клиентов: </p><ul data-v-a512bd9e><li data-v-a512bd9e>Фамилия, имя, отчество;</li><li data-v-a512bd9e>Номер контактного телефона;</li><li data-v-a512bd9e>Адрес электронной почты;</li><li data-v-a512bd9e> Иные данные, предусмотренные специальными формами на сайте ООО «Тис Лоджистик». </li></ul><h2 data-v-a512bd9e>8. Условия обработки персональных данных:</h2><p data-v-a512bd9e> 8.1. Обработка персональных данных осуществляется с согласия субъекта персональных данных на обработку его персональных данных. </p><p data-v-a512bd9e> 8.2. Обработка персональных данных необходима для осуществления правосудия, исполнения судебного акта, акта другого органа или должностного лица, подлежащих исполнению в соответствии с законодательством Российской Федерации об исполнительном производстве. </p><p data-v-a512bd9e> 8.3. Обработка персональных данных необходима для исполнения договора, стороной которого либо выгодоприобретателем или поручителем по которому является субъект персональных данных, а также для заключения договора по инициативе субъекта персональных данных или договора, по которому субъект персональных данных будет являться выгодоприобретателем или поручителем. </p><p data-v-a512bd9e> 8.4. Обработка персональных данных необходима для осуществления прав и законных интересов оператора или третьих лиц либо для достижения общественно значимых целей при условии, что при этом не нарушаются права и свободы субъекта персональных данных. </p><p data-v-a512bd9e> 8.5. К обработке персональных данных допускаются только те работники ООО «Тис Лоджистик», в должностные обязанности которых входит обработка персональных данных. Указанные работники имеют право получать только те персональные данные, которые необходимы им для выполнения своих должностных обязанностей. </p><p data-v-a512bd9e>8.6. Обработка персональных данных осуществляется путем:</p><ul data-v-a512bd9e><li data-v-a512bd9e> получения информации, содержащей персональные данные, в устной и письменной форме непосредственно от субъектов персональных данных; </li><li data-v-a512bd9e> предоставления субъектами персональных данных оригиналов необходимых документов; </li><li data-v-a512bd9e> получения заверенных в установленном порядке копий документов, содержащих персональные данные или копирования оригиналов документов; </li><li data-v-a512bd9e> получения персональных данных при направлении запросов в органы государственной власти, государственные внебюджетные фонды, иные государственные органы, органы местного самоуправления, коммерческие и некоммерческие организации, физическим лицам в случаях и порядке, предусмотренных законодательством Российской Федерации; </li><li data-v-a512bd9e> получения персональных данных из общедоступных источников; </li><li data-v-a512bd9e> внесения персональных данных в информационные системы ООО «Тис Лоджистик»; </li><li data-v-a512bd9e> использования иных средств и способов фиксации персональных данных, получаемых в рамках осуществляемой ООО «Тис Лоджистик» деятельности. </li></ul><p data-v-a512bd9e> 8.7. Передача персональных данных третьим лицам допускается с письменного согласия субъектов персональных данных, за исключением случаев, когда это необходимо в целях предупреждения угрозы жизни и здоровью субъектов персональных данных, а также в иных случаях, установленных законодательством Российской Федерации. </p><p data-v-a512bd9e> 8.8. При передаче персональных данных третьим лицам в соответствии с заключенными договорами ООО «Тис Лоджистик» обеспечивает обязательное выполнение требований законодательства Российской Федерации в области персональных данных. </p><p data-v-a512bd9e> 8.9. Передача персональных данных в уполномоченные органы исполнительной власти и организации осуществляется в соответствии с требованиями законодательства Российской Федерации. Сроки хранения персональных данных в ООО «Тис Лоджистик» определяются в соответствии с законодательством Российской Федерации. </p><h2 data-v-a512bd9e> 9. Порядок сбора, хранения, передачи и других видов обработки персональных данных: </h2><p data-v-a512bd9e> Безопасность персональных данных, которые обрабатываются Оператором, обеспечивается путем реализации правовых, организационных и технических мер, необходимых для выполнения в полном объеме требований действующего законодательства в области защиты персональных данных. </p><p data-v-a512bd9e> 9.1. Оператор обеспечивает сохранность персональных данных и принимает все возможные меры, исключающие доступ к персональным данным неуполномоченных лиц. </p><p data-v-a512bd9e> 9.2. Персональные данные Пользователя никогда, ни при каких условиях не будут переданы третьим лицам, за исключением случаев, связанных с исполнением действующего законодательства либо в случае, если субъектом персональных данных дано согласие Оператору на передачу данных третьему лицу для исполнения обязательств по гражданско-правовому договору. </p><p data-v-a512bd9e> 9.3. В случае выявления неточностей в персональных данных, Пользователь может актуализировать их самостоятельно, путем направления Оператору уведомление на адрес электронной почты Оператора info@tislogistic.ru с пометкой «Актуализация персональных данных». </p><p data-v-a512bd9e> 9.4. Срок обработки персональных данных определяется достижением целей, для которых были собраны персональные данные, если иной срок не предусмотрен договором или действующим законодательством. Пользователь может в любой момент отозвать свое согласие на обработку персональных данных, направив Оператору уведомление посредством электронной почты на электронный адрес Оператора info@tislogistic.ru с пометкой «Отзыв согласия на обработку персональных данных». </p><p data-v-a512bd9e> 9.5. Вся информация, которая собирается сторонними сервисами, в том числе платежными системами, средствами связи и другими поставщиками услуг, хранится и обрабатывается указанными лицами (Операторами) в соответствии с их Пользовательским соглашением и Политикой конфиденциальности. Субъект персональных данных и/или Пользователь обязан самостоятельно своевременно ознакомиться с указанными документами. Оператор не несет ответственность за действия третьих лиц, в том числе указанных в настоящем пункте поставщиков услуг. </p><p data-v-a512bd9e> 9.6. Установленные субъектом персональных данных запреты на передачу (кроме предоставления доступа), а также на обработку или условия обработки (кроме получения доступа) персональных данных, разрешенных для распространения, не действуют в случаях обработки персональных данных в государственных, общественных и иных публичных интересах, определенных законодательством РФ. </p><p data-v-a512bd9e> 9.7. Оператор при обработке персональных данных обеспечивает конфиденциальность персональных данных. </p><p data-v-a512bd9e> 9.8. Оператор осуществляет хранение персональных данных в форме, позволяющей определить субъекта персональных данных, не дольше, чем этого требуют цели обработки персональных данных, если срок хранения персональных данных не установлен федеральным законом, договором, стороной которого, выгодоприобретателем или поручителем по которому является субъект персональных данных. </p><p data-v-a512bd9e> 9.9. Условием прекращения обработки персональных данных может являться достижение целей обработки персональных данных, истечение срока действия согласия субъекта персональных данных или отзыв согласия субъектом персональных данных, а также выявление неправомерной обработки персональных данных. </p><h2 data-v-a512bd9e> 10. Перечень действий, производимых Оператором с полученными персональными данными: </h2><p data-v-a512bd9e> 10.1. Оператор осуществляет сбор, запись, систематизацию, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ), обезличивание, блокирование, удаление и уничтожение персональных данных. </p><p data-v-a512bd9e> 10.2. Оператор осуществляет автоматизированную обработку персональных данных с получением и/или передачей полученной информации по информационно-телекоммуникационным сетям или без таковой. </p><h2 data-v-a512bd9e>11. Трансграничная передача персональных данных:</h2><p data-v-a512bd9e> 11.1. Оператор до начала осуществления трансграничной передачи персональных данных обязан убедиться в том, что иностранным государством, на территорию которого предполагается осуществлять передачу персональных данных, обеспечивается надежная защита прав субъектов персональных данных. </p><p data-v-a512bd9e> 11.2. Трансграничная передача персональных данных на территории иностранных государств, не отвечающих вышеуказанным требованиям, может осуществляться только в случае наличия согласия в письменной форме субъекта персональных данных на трансграничную передачу его персональных данных и/или исполнения договора, стороной которого является субъект персональных данных. </p><h2 data-v-a512bd9e>12. Конфиденциальность персональных данных:</h2><p data-v-a512bd9e> Оператор и иные лица, получившие доступ к персональным данным, обязаны не раскрывать третьим лицам и не распространять персональные данные без согласия субъекта персональных данных, если иное не предусмотрено федеральным законом. </p><h2 data-v-a512bd9e>13. Заключительные положения:</h2><p data-v-a512bd9e> 13.1. Пользователь может получить любые разъяснения по интересующим вопросам, касающимся обработки его персональных данных, обратившись к Оператору с помощью электронной почты info@tislogistic.ru </p><p data-v-a512bd9e> 13.2. В данном документе будут отражены любые изменения политики обработки персональных данных Оператором. Политика действует бессрочно до замены ее новой версией. </p><p data-v-a512bd9e> 13.3. Актуальная версия Политики в свободном доступе расположена в сети Интернет по адресу <a href="https://tislogistic.ru/politika-konfidencialnosti" data-v-a512bd9e>https://tislogistic.ru/politika-konfidencialnosti</a></p><br data-v-a512bd9e><br data-v-a512bd9e><a class="download" href="/politika-konfidencialnosti.pdf" download="Политика_обработки_ПД_от_01.08.2023.pdf" target="_blank" data-v-a512bd9e>Политика_обработки_ПД_от_01_08_2023.pdf</a>',85),_={__name:"politika-konfidencialnosti",setup(a){return i({title:"Политика конфиденциальности"}),(u,f)=>{const t=e;return s(),b("div",null,[d("section",null,[r,d("div",null,[v(t,{class:"breadcrumbs"}),n])])])}}},w=p(_,[["__scopeId","data-v-a512bd9e"]]);export{w as default};
